import React from 'react'; 
// js 파일 뿐 아니라 이미지도 가능가능!
import logo from './logo.svg';
// css? 가능!
import './App.css';

function App() {
  const number = 11;
  
  return (
    <div className="App">
      <p>안녕하세요! 리액트 반입니다 :)</p>
      <p>{number > 10 ? number+'은 10보다 크다' : number+'은 10보다 작다'}</p>
    </div>
  );
}

export default App;
